import Chat from "./Chat";
import Dialogue from "./Dialogue";
import Folder from "./Folder";
import IUser from "./IUser";
import Message from "./Message";
import MySelfUser from "./MySelfUser";
import User from "./User";
const dialog: string[] = [
    "Привіт",
    "Привіт! Як ти сьогодні?",
    "Добре, дякую! Як у тебе?",
    "Теж непогано. Чим займаєшся?",
    "Працюю над новим проектом.",
    "Звучить цікаво. Розкажи більше про нього.",
    "Проект пов'язаний з розробкою веб-додатків.",
    "Цікаво. Я теж трохи розумію веб-розробку. Які технології ви використовуєте?",
    "Ми використовуємо React для фронтенду та Node.js для бекенду.",
    "Дуже цікаво! Я теж вивчаю React. Може, поділишся корисними ресурсами? Бо мені дуже цікаво дізнатись про цю тему детальніше",
  ];
  const images:string[]=[
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "https://cdn.discordapp.com/attachments/1043985846715564102/1154700004942950501/image.png"
  ]
export let mySelfUser:MySelfUser=new MySelfUser("Denis","data:image/jpeg;base64,",1);
let users:User[]=[];

for (let i = 1; i <= 14; i++) {
    const user = new User(`User ${i.toString()}`,images[i-1] , i);
    users.push(user);
  }
 for (let i = 15; i <= 28; i++) {
    const user = new User(`User ${i.toString()}`,images[i-15] , i,);
    users.push(user);
  }
let chats: Chat[] = [];
for (let i = 0; i < 28; i++) {
    let map:Map<number,number>=new Map<number,number>();
    
    let messages:Message[]=[];
    const now = new Date(); 
    now.setDate(now.getDate());
    const numberOfMessages:number = Math.floor(Math.random() * (dialog.length + 1)); 
    for(let j:number=0;j<numberOfMessages;j++){
        messages.push(
            new Message(
              dialog[j],
              Math.random() < 0.5 ? users[i] : mySelfUser,
              new Date(now.getTime()- j *5* 60 * 1000),j 
            )
          );          
    }
    map.set(users[i].id,numberOfMessages-Math.floor(Math.random() * (numberOfMessages)));
    map.set(mySelfUser.id,numberOfMessages-Math.floor(Math.random() * (numberOfMessages)));
    chats.push(new Dialogue(users[i],messages,map))
}


let folder1:Folder=new Folder("All Chats",chats)

let folders:Folder[]=[];
folders.push(folder1);
for (let i = 1; i <= 3; i++) {
    const randomChatCount = Math.floor(Math.random() * (chats.length + 1));
    const randomChats = chats.slice(0, randomChatCount); 
  
    const folderName = `Folder ${i}`;
    const folder = new Folder(folderName, randomChats);
    folders.push(folder);
  }
mySelfUser.folders=folders;
